import React from 'react';

function Address() {
    return (
        <div>
            <h3>Addres</h3>
            <p>Newport Beach, CA 92660</p>
            <p>Email: gastronomia@gmail.com</p>
            <p>Phone: +1 (212) 232 3445</p>
        </div>
    );
}

export default Address;
